import React from "react";
import Navbar from "../components/Navbar";
import FlightSearch from "../components/FlightSearch";

const FlightsPage = () => {
  const handleSearch = (params: any) => {
    console.log("Căutare inițiată:", params);
    // Aici poți integra API mai târziu
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 via-white to-blue-50">
      <Navbar />

      <main className="flex flex-col items-center px-6 py-16">
        <div className="bg-white rounded-3xl shadow-xl max-w-4xl w-full p-8 sm:p-12">
          <h2 className="text-4xl sm:text-5xl font-extrabold mb-6 text-center text-blue-900 drop-shadow-md">
            Caută un zbor
          </h2>
          <hr className="border-blue-200 mb-8" />

          <FlightSearch onSearch={handleSearch} />
        </div>
      </main>
    </div>
  );
};

export default FlightsPage;
